  false,\n\t\"url\": null,\n\t\"notes\": \"Absolute U- and V-component ocean current
  vectors from Shipboard Acoustic Doppler Current Profilers (SADCP), as both a high
  frequency sampling (nominally 5 minutes with 8 m depth bins) and an averaged subset
  (hourly time and 10 m depth means), are provided for the global oceans. The depth
  range is typically from 20 to 300 m although recent technology has allowed penetration
  to over 1 km. The high frequency samples along with ancillary parameters are provided
  in the Common Oceanographic Data Access System (CODAS) binary format. The standard
  (averaged) subset is stored in ASCII. This dataset represents the cruises acquired
  from 16 June 1985 through 23 March 2001 at the Joint Archive for SADCP, a collaboration
  of NOAA and the E.Firing ADCP Laboratory at the University of Hawaii. The data have
  been contributed by both US and international organizations.\",\n\t\"owner_org\":
